webpackJsonp([0x83dc89996e22],{5593:function(e,t){e.exports={data:{post:{html:'<p><a href="http://diveintomark.org/">diveintomark</a> has started <a href="http://diveintomark.org/archives/2002/05/31.html#more_on_rss_autodiscovery">championing using a link tag to reference rss feeds</a>, something like this:</p>\n<p><code>&lt;link rel="alternate" type="text/xml" title="XML"<br />\nhref="http://www.papascott.de/xml/index.rdf" /&gt;</code></p>\n<p>Then an aggregator like Radio Userland or Amphetadesk would in theory be able to automatically find the feed. Sounds cool to me.</p>\n<p>(The title of this entry is an obscure lyric reference, but I\'d guess someone like <a href="http://www.vfth.com">Alwin</a> would get it right away.)</p>',fields:{title:"Go Forward! Move Ahead!",date:"31 May 2002",url:"https://papascott.de/2002-05-31-go-forward-move-ahead/"}}},pathContext:{slug:"/2002-05-31-go-forward-move-ahead/",prev:{fields:{title:"Don't Read This Book, Film At 11",date:"31 May 2002",slug:"/2002-05-31-dont-read-this-book-film-at-11/"}},next:{fields:{title:"100% Liberal Quaker",date:"01 Jun 2002",slug:"/2002-06-01-100-liberal-quaker/"}}}}}});
